// [0] Mobile overlay toggle (open & close) //
var mobButtonToggle = document.querySelector('.mbl-toggle-wrapp');
if (mobButtonToggle) {
  mobButtonToggle.addEventListener('click', function () {
    var mobileOverlay = document.getElementById('mbl-menu-ovrr-wrapp');
    mobButtonToggle.classList.toggle('mbl-toggle-activated');
    // Click Toggle //
    if (mobileOverlay) {
      document.querySelector('body').classList.toggle('global-block-body-scroll-cst');
      mobileOverlay.classList.toggle('activated-mbl-menu-ovrr-wrapp');
    }
  });
}
// [1] Mobile Chevron dropdown toggle //
document.querySelectorAll('.mbl-dropdown-watcher-cst .bst-opt-chevron-active-cst').forEach(function (mobbutton) {
  mobbutton.addEventListener('click', function (e) {
    e.preventDefault();
    // Class vars //
    var activeDropdownClass = 'active-mobile-submenu-cst';
    var activeItemClass = 'active-mobile-item-cst';
    var activeChevronClass = 'active-mobile-chevron-cst';
    // Setup click event vars //
    var parentDropdown = mobbutton.closest('ul');
    var closestLi = mobbutton.closest('li');
    var closestChev = mobbutton.closest('.bst-opt-chevron-active-cst');
    var closestDropdown = closestLi.querySelector('.sub-menu');
    var closestLiID = closestLi.getAttribute('ID');
    // Only close all instances if a top level item is clicked //
    if (!parentDropdown.classList.contains('sub-menu')) {
      document.querySelectorAll('.mbl-dropdown-watcher-cst li').forEach(function (openDropdown) {
        var thisMenuItemID = openDropdown.getAttribute('ID');
        // check if its not the current item (toggle controls that) //
        if (thisMenuItemID != closestLiID) {
          var targetSubMenu = document.querySelector('#' + thisMenuItemID + ' .sub-menu');
          var closestChevRem = openDropdown.querySelector('.bst-opt-chevron-active-cst');
          // remove li //
          closestChevRem.classList.remove(activeChevronClass);
          openDropdown.classList.remove(activeItemClass);
          // remove drodown //
          if (targetSubMenu) {
            targetSubMenu.classList.remove(activeDropdownClass);
          }
        }
      });
    }
    // Add active class //
    if (!closestLi.classList.contains(activeDropdownClass)) {
      closestLi.classList.toggle(activeItemClass);
      closestChev.classList.toggle(activeChevronClass);
      closestDropdown.classList.toggle(activeDropdownClass);
    }
  });
});

